  open,
  handleClose,
  type,
}: ModalTechsProps): ReactElement => {
  return (
    <Modal
      open={open}
      onClose={handleClose}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
    >
      <TechForm>
        <p>gay sex</p>
      </TechForm>
    </Modal>
  );
};
